import Button from "react-bootstrap/Button";
import Badge from "react-bootstrap/Badge";

const CardFooter = ({id, price, category, isLoggedIn}) =>{
    const clicked   = (e) => {
        console.log(e);
    };
    if (isLoggedIn){
        return<Button id ={id} variant="primary" onClick={clicked}>
            ${price}</Button>;
    }else{
        return(
            <Badge pill bg="secondary">
            {category}
            </Badge>
        );
    }

};
export default CardFooter;
